function esc(input) {
	if(input != null && input != undefined ) {
		return input
			.replace('&', '&amp;')
			.replace('<','&lt;')
			.replace('>', '&gt;');
	} else {
		return "";
	} 
	
};


/**
 * Add commas to numeric values
 */
$.fn.digits = function(){ 
	return this.each(function(){ 
		$(this).text( $(this).text().replace(/(\d)(?=(\d\d\d)+(?!\d))/g, "$1,") ); 
	});
};

